-- quick insert script for inserting new column with headshot image urls for employees

CREATE TEMPORARY TABLE IF NOT EXISTS sales_images(
    name text,
    img_url text
);

-- make temp table with url-name mapping
INSERT into sales_images(name,img_url)
VALUES 
    ('Andrea','data:image/jpeg;base64,'),
    ('Anna Bauer', 'data:image/jpeg;base64,'),
    ('Christiane Hfer', 'data:image/jpeg;base64,'),
    ('Jana Tilgner', 'data:image/jpeg;base64,'),
    ('Leon Grbner', 'data:image/jpeg;base64,'),
    ('Rebekka Geiss', 'data:image/jpeg;base64,'),
    ('Vincent Schfers', 'data:image/jpeg;base64,')
    ;

-- make new col
ALTER TABLE zoho."Users"
ADD COLUMN headshot_image_url text;


-- set new column
UPDATE zoho."Users"
SET headshot_image_url = (SELECT img_url FROM sales_images
                          WHERE sales_images.name = "Full Name")
;